script: |
  super -f text -I q11684.spq | sort > q11684.out

inputs:
  - name: q11684.spq
    data: |
      SELECT + COUNT ( * ) FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 + - 61 NOT BETWEEN NULL AND + 87 + - 9 * + col1 + - col0;
  - name: tab1

outputs:
  - name: q11684.out
    data: |
      1
